<p class="MsoNormal"><a target="&quot;_top&quot;" href="http://translate.googleusercontent.com/translate_c?hl=ru&amp;prev=/search?q=http://www.corbin.com/materials/pu_index.html&amp;hl=ru&amp;biw=1280&amp;bih=558&amp;prmd=ivns&amp;rurl=translate.google.com.ua&amp;sl=en&amp;u=http://www.corbin.com/materials/asphalt.html&amp;usg=ALkJrhiNZk597AC6S8gxALqU1KyXiindDA"><img src="data:image/png;base64," alt="" /></a><b>Асфальт Винил</b>&nbsp;Интересный образец с грубой текстурой, которая дает хорошее сцепление с дорогой и визуально приятный контраст. Доступно только в черном цвете(такой же, как настоящий асфальт).</p>
<p class="MsoNormal"><a target="&quot;_top&quot;" href="http://translate.googleusercontent.com/translate_c?hl=ru&amp;prev=/search?q=http://www.corbin.com/materials/pu_index.html&amp;hl=ru&amp;biw=1280&amp;bih=558&amp;prmd=ivns&amp;rurl=translate.google.com.ua&amp;sl=en&amp;u=http://www.corbin.com/materials/carbonium.html&amp;usg=ALkJrhgjDN54sY8ELT-iJ9u4JQqkNaZ3Sg"><img src="data:image/png;base64," alt="" /></a><b>Карбониевый Винил</b>&nbsp;Тисненный материал винила используется для высокотехнологичных видов. Очень блестящий с более агрессивным рисунком, чем наш стандартный карбоновый вид. Прекрасно смотрится на спортивных мотоциклах и мотоциклах двойного спорта.</p>
<p class="MsoNormal"><a target="&quot;_top&quot;" href="http://translate.googleusercontent.com/translate_c?hl=ru&amp;prev=/search?q=http://www.corbin.com/materials/pu_index.html&amp;hl=ru&amp;biw=1280&amp;bih=558&amp;prmd=ivns&amp;rurl=translate.google.com.ua&amp;sl=en&amp;u=http://www.corbin.com/materials/blkcfvinyl.html&amp;usg=ALkJrhjQOT8D9EaOj9zE_mMlC9tVHdK6yQ"><img src="data:image/png;base64," alt="" /></a><b>Винил, структура углеродного волокна, Черный</b>&nbsp;Тисненный материал винила используется в боковых панелях. Также отлично подходит для внедорожных мотоциклов, где кожаные сидения не рекомендуются.</p>
<p class="MsoNormal"><a target="&quot;_top&quot;" href="http://translate.googleusercontent.com/translate_c?hl=ru&amp;prev=/search?q=http://www.corbin.com/materials/pu_index.html&amp;hl=ru&amp;biw=1280&amp;bih=558&amp;prmd=ivns&amp;rurl=translate.google.com.ua&amp;sl=en&amp;u=http://www.corbin.com/materials/bluecfvinyl.html&amp;usg=ALkJrhgPYyQeiHQlr1pm75hWfg9SvEEaYA"><img src="data:image/png;base64," alt="" /></a><b>Винил, структура углеродного волокна, Голубой</b>&nbsp;Тисненный материал винила используется в боковых панелях. Также отлично подходит для внедорожных мотоциклов, где кожаные сидения не рекомендуются.&nbsp;&nbsp;Этот материал не совпадет по цвету с нашей синей кожей со структурой углеродного волокна.</p>
<p class="MsoNormal"><a target="&quot;_top&quot;" href="http://translate.googleusercontent.com/translate_c?hl=ru&amp;prev=/search?q=http://www.corbin.com/materials/pu_index.html&amp;hl=ru&amp;biw=1280&amp;bih=558&amp;prmd=ivns&amp;rurl=translate.google.com.ua&amp;sl=en&amp;u=http://www.corbin.com/materials/charcfvinyl.html&amp;usg=ALkJrhg9eJMCHrjdNH1xtUo57_yvQtjn2w"><img src="data:image/png;base64," alt="" /></a><b>Винил, структура углеродного волокна, Темно-серый</b>&nbsp;Этот материал идеально подходит для боковых панелей на внедорожных сидениях. Обеспечивает вид углеродного волокна с тисненной поверхностю.</p>
<p class="MsoNormal"><a target="&quot;_top&quot;" href="http://translate.googleusercontent.com/translate_c?hl=ru&amp;prev=/search?q=http://www.corbin.com/materials/pu_index.html&amp;hl=ru&amp;biw=1280&amp;bih=558&amp;prmd=ivns&amp;rurl=translate.google.com.ua&amp;sl=en&amp;u=http://www.corbin.com/materials/redcfvinyl.html&amp;usg=ALkJrhh4q_ATx5FjY0FbWS3Po_l5uLsLoQ"><img src="data:image/png;base64," alt="" /></a><b>Винил, структура углеродного волокна, Красный</b>&nbsp;Виниловый материал является лучшим выбором для зон высокого износа. Этот тисненный винил обеспечивает хорошую текстуру углерода на спортивных мотоциклах.</p>
<p class="MsoNormal"><a target="&quot;_top&quot;" href="http://translate.googleusercontent.com/translate_c?hl=ru&amp;prev=/search?q=http://www.corbin.com/materials/pu_index.html&amp;hl=ru&amp;biw=1280&amp;bih=558&amp;prmd=ivns&amp;rurl=translate.google.com.ua&amp;sl=en&amp;u=http://www.corbin.com/materials/silvcfvinyl.html&amp;usg=ALkJrhjlyjUX_DzFh9cdoB4XJYB7kB4v-w"><img src="data:image/png;base64," alt="" /></a><b>Винил, структура углеродного волокна, Серебряный</b>&nbsp;Отлично подходит для сидений мотоциклов. Рельефный виниловый материал обеспечивает спортивный вид и&nbsp;&nbsp;прекрасно смотрится.</p>
