<p class="MsoNormal"><a target="&quot;_top&quot;" href="http://translate.googleusercontent.com/translate_c?hl=ru&amp;prev=/search?q=http://www.corbin.com/materials/pu_index.html&amp;hl=ru&amp;biw=1280&amp;bih=558&amp;prmd=ivns&amp;rurl=translate.google.com.ua&amp;sl=en&amp;u=http://www.corbin.com/materials/husky.html&amp;usg=ALkJrhjzRRCg8krWWeEGGaS8fcqYL0fv5g"><img src="data:image/png;base64," alt="" /></a><b>Ткань на основе прочной резины</b><b>, Черный</b>&nbsp;Черный слой толстой ткани на основе прочной резины. Отличный выбор для внедорожных мотоциклов.</p>
